"use strict";var KTDocsSearch=function(){var element;var formElement;var mainElement;var resultsElement;var wrapperElement;var emptyElement;var searchObject;var processs=function(search){var results=0;var searchable=[].slice.call(resultsElement.querySelectorAll('[data-kt-searchable="true"]'));searchable.map(function(element){var query=searchObject.getQuery();if(element.innerText.toLowerCase().indexOf(query.toLowerCase())!==-1){element.classList.remove("d-none");results++}else{element.classList.add("d-none")}});mainElement.classList.add("d-none");if(results===0){resultsElement.classList.add("d-none");emptyElement.classList.remove("d-none")}else{resultsElement.classList.remove("d-none");emptyElement.classList.add("d-none")}search.complete()};var clear=function(search){mainElement.classList.remove("d-none");resultsElement.classList.add("d-none");emptyElement.classList.add("d-none")};return{init:function(){element=document.querySelector("#kt_docs_search");if(!element){return}wrapperElement=element.querySelector('[data-kt-search-element="wrapper"]');formElement=element.querySelector('[data-kt-search-element="form"]');mainElement=element.querySelector('[data-kt-search-element="main"]');resultsElement=element.querySelector('[data-kt-search-element="results"]');emptyElement=element.querySelector('[data-kt-search-element="empty"]');searchObject=new KTSearch(element);searchObject.on("kt.search.process",processs);searchObject.on("kt.search.clear",clear)}}}();KTUtil.onDOMContentLoaded(function(){KTDocsSearch.init()});